import React from 'react'
import IDataCardVSM from '../Data/IDataCardVSM'
import IDataOrderItem from '../Data/IDataOrderItem'
import IDataBufferVSM from '../Data/IDataBufferVSM'
import IDataEtapVSM from '../Data/IDataEtapVSM'

import Buffer from './Buffer'
import Etap from './Etap'

import ArrowRightAltIcon from '@material-ui/icons/ArrowRightAlt';

const ViewItemSection = (props:{data: IDataCardVSM[], orderItems?: IDataOrderItem[], numberSection: number, lastSection: number}) =>
{
  let  listSections;
  let flag = props.data.length < 1 as boolean;

  listSections = props.data.map((item : IDataCardVSM, index: number,) =>

    <div key={index} style={{display: 'block ruby',  paddingTop: flag? '50%': ''}}>
      <Buffer buffer={item.bufferVSM as IDataBufferVSM}/>
      <div style={{verticalAlign: 'middle'}}>
        <ArrowRightAltIcon style={{width: '50px', height: '100%'}}/>
      </div>
      <Etap etap={item.etapVSM as IDataEtapVSM}/>
      {props.numberSection !==  props.lastSection ? 
        <div style={{verticalAlign: 'middle'}}>
          <ArrowRightAltIcon style={{width: '50px', height: '100%'}}/>
        </div>
      :
       null}
    </div>
  )




  return(
    <div style={{display: flag ?'block ruby': '', border: '2px dashed #cec9c9'}}>
        {listSections}
    </div>
  )
}

export default ViewItemSection;
